import React, { Component } from "react";
import { connect } from "react-redux";
import * as actions from "./../../../Actions";

class Index extends Component {
  render() {
    return (
      <div className="container-fluid mt-5" id="manager-users">
        <div className="container">
          <div className="row">
            <div className="col-12 text-center">
              <h3 className="font-ubun">Manager Users</h3>
            </div>
            <div className="col-12">
              <table className="table">
                <thead>
                  <tr>
                    <th>STT</th>
                    <th>Account</th>
                    <th>Password</th>
                    <th>Status</th>
                    <th>Role</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody></tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const mapState = (state) => {
  return {
    admins: state.usersAdmin,
    customers: state.users,
  };
};

const mapDispatch = (dispatch) => {
  return {
    getAdmins: () => dispatch(actions.acGetUserAdminRequest()),
    getCustomer: () => dispatch(actions.acGetUsersRequest),
  };
};

export default connect(mapState, mapDispatch)(Index);
